import React, { useState } from 'react';
import Welcome from './Welcome';
import Accueil from './Accueil';
import './App.css';

function App() {
  const [showAccueil, setShowAccueil] = useState(false);

  // Fonction pour passer à Accueil
  const handleEnter = (e) => {
    e.preventDefault();
    setShowAccueil(true);
  };

  return (
    <>
      {!showAccueil ? (
        <Welcome onEnter={handleEnter} />
      ) : (
        <Accueil />
      )}
    </>
  );
}

export default App;
